'Memcached::OPT_AUTO_EJECT_HOSTS' => 'Removes disabled servers from the list. Use together with `Memcached::OPT_SERVER_FAILURE_LIMIT` and `Memcached::OPT_SERVER_TIMEOUT_LIMIT`.

This option is replaced by `Memcached::OPT_REMOVE_FAILED_SERVERS`.

Type: `bool`, default: `false`.',
'Memcached::OPT_BINARY_PROTOCOL' => 'Enable the use of the binary protocol. Please note that you cannot toggle this option on an open connection.

Type: `bool`, default: `false`.',
'Memcached::OPT_BUFFER_WRITES' => 'Enables or disables buffered I/O. Enabling buffered I/O causes storage commands to "buffer" instead of being sent. Any action that retrieves data causes this buffer to be sent to the remote connection. Quitting the connection or closing down the connection will also cause the buffered data to be pushed to the remote connection.

Type: `bool`, default: `false`.',
'Memcached::OPT_CACHE_LOOKUPS' => 'Enables or disables caching of DNS lookups.

Type: `bool`, default: `false`.',
'Memcached::OPT_COMPRESSION' => 'Enables or disables payload compression. When enabled, item values longer than a certain threshold (currently 2000 bytes) will be compressed during storage and decompressed during retrieval transparently. The threshold can be configured using the memcached.compression_threshold ini setting.

Type: `bool`, default: `true`.',
'Memcached::OPT_COMPRESSION_LEVEL' => 'Specifies the compression level to use, if compression is enabled.

`Memcached::COMPRESSION_FASTLZ` does not support compression levels. `Memcached::COMPRESSION_ZSTD`: minimum level is `-22` and maximum level is `22`. `Memcached::COMPRESSION_ZLIB`: minimum level is `0` and maximum level is `9`.

Type: `int`, default: `3`.',
'Memcached::OPT_COMPRESSION_TYPE' => 'Specifies the compression algorithm to use, if compression is enabled. The valid algorithms are `Memcached::COMPRESSION_FASTLZ`, `Memcached::COMPRESSION_ZLIB` and `Memcached::COMPRESSION_ZSTD`.

Type: `int`, default: `Memcached::COMPRESSION_FASTLZ`.',
'Memcached::OPT_CONNECT_TIMEOUT' => 'In non-blocking mode this set the value of the timeout during socket connection, in milliseconds.

Type: `int`, default: `1000`.',
'Memcached::OPT_DEAD_TIMEOUT' => 'The amount of time, in seconds, to wait until retrying dead servers. `0` means no retry.

Type: `int`, default: `0`.',
'Memcached::OPT_DISTRIBUTION' => 'Specifies the method of distributing item keys to the servers. Currently supported methods are modulo and consistent hashing. Consistent hashing delivers better distribution and allows servers to be added to the cluster with minimal cache losses.

Type: `int`, default: `Memcached::DISTRIBUTION_MODULA`.',
'Memcached::OPT_HASH' => 'Specifies the hashing algorithm used for the item keys. The valid values are supplied via `Memcached::HASH_*` constants. Each hash algorithm has its advantages and its disadvantages. Go with the default if you don\'t know or don\'t care.

Type: `int`, default: `Memcached::HASH_DEFAULT`',
'Memcached::OPT_LIBKETAMA_COMPATIBLE' => 'Enables or disables compatibility with libketama-like behavior. When enabled, the item key hashing algorithm is set to MD5 and distribution is set to be weighted consistent hashing distribution. This is useful because other libketama-based clients (Python, Ruby, etc.) with the same server configuration will be able to access the keys transparently.

It is highly recommended to enable this option if you want to use consistent hashing, and it may be enabled by default in future releases.

Type: `bool`, default: `false`.',
'Memcached::OPT_LIBKETAMA_HASH' => 'Specifies the hashing algorithm for host mapping.

Type: `int`.',
'Memcached::OPT_NO_BLOCK' => 'Enables or disables asynchronous I/O. This is the fastest transport available for storage functions.

Type: `bool`, default: `false`.',
'Memcached::OPT_NOREPLY' => 'Enables or disables ignoring the result of storage commands (set, add, replace, append, prepend, delete, increment, decrement, etc.). Storage commands will be sent without spending time waiting for a reply (there would be no reply). Retrieval commands such as `Memcached::get` are unaffected by this setting.

Type: `bool`, default: `false`.',
'Memcached::OPT_NUMBER_OF_REPLICAS' => 'Stores this many replicas of each item on different servers.

Type: `int`, default: `0`.',
'Memcached::OPT_POLL_TIMEOUT' => 'Timeout for connection polling, in milliseconds.

Type: `int`, default: `1000`.',
'Memcached::OPT_PREFIX_KEY' => 'This can be used to create a "domain" for your item keys. The value specified here will be prefixed to each of the keys. It cannot be longer than `128` characters and will reduce the maximum available key size. The prefix is applied only to the item keys, not to the server keys.

Type: `string`, default: `""`.',
'Memcached::OPT_RANDOMIZE_REPLICA_READS' => 'Randomizes replica read server.

Type: `bool`, default: `false`.',
'Memcached::OPT_RECV_TIMEOUT' => 'Socket reading timeout, in microseconds. In cases where you cannot use non-blocking I/O this will allow you to still have timeouts on the reading of data.

Type: `int`, default: `0`.',
'Memcached::OPT_REMOVE_FAILED_SERVERS' => 'Removes disabled servers from the list. Use together with `Memcached::OPT_SERVER_FAILURE_LIMIT` and `Memcached::OPT_SERVER_TIMEOUT_LIMIT`.

Type: `bool`, default: `false`.',
'Memcached::OPT_RETRY_TIMEOUT' => 'The amount of time, in seconds, to wait until retrying a failed connection attempt.

Type: `int`, default: `2`.',
'Memcached::OPT_SEND_TIMEOUT' => 'Socket sending timeout, in microseconds. In cases where you cannot use non-blocking I/O this will allow you to still have timeouts on the sending of data.

Type: `int`, default: `0`.',
'Memcached::OPT_SERIALIZER' => 'Specifies the serializer to use for serializing non-scalar values. The valid serializers are `Memcached::SERIALIZER_PHP`, `Memcached::SERIALIZER_IGBINARY`, `Memcached::SERIALIZER_JSON`, `Memcached::SERIALIZER_JSON_ARRAY` and `Memcached::SERIALIZER_MSGPACK`.

Type: `int`, default: `Memcached::SERIALIZER_IGBINARY` if available, then `Memcached::SERIALIZER_MSGPACK` if available, then `Memcached::SERIALIZER_PHP`.',
'Memcached::OPT_SERVER_FAILURE_LIMIT' => 'Specifies the failure limit for server connection attempts. The server will be removed after this many continuous connection failures.

Type: `int`, default: `5`.',
'Memcached::OPT_SERVER_TIMEOUT_LIMIT' => 'Specifies the timeout limit for server connection attempts. The server will be removed after this many continuous connection timeouts.

Type: `int`, default: `0`.',
'Memcached::OPT_SOCKET_RECV_SIZE' => 'The maximum socket receive buffer in bytes.

Type: `int`, default: varies by platform/kernel configuration.',
'Memcached::OPT_SOCKET_SEND_SIZE' => 'The maximum socket send buffer in bytes.

Type: `int`, default: varies by platform/kernel configuration.',
'Memcached::OPT_TCP_KEEPALIVE' => 'Enables TCP keep alive.

Type: `bool`, default: `false`.',
'Memcached::OPT_TCP_NODELAY' => 'Enables or disables the no-delay feature for connecting sockets (may be faster in some environments).

Type: `bool`, default: `false`.',
'Memcached::OPT_USE_UDP' => 'Uses UDP instead of TCP.

Type: `bool`, default: `false`.',
'Memcached::OPT_VERIFY_KEY' => 'Enables verification of keys by memcached.

Type: `bool`, default: `false`.',
